import React from "react";
import BrandNavbar from "../../../components/BrandNavbar";

const PostCampaign = () => {
  return (
    <>
      <BrandNavbar />
      <div className="p-10 text-center">
        <h1 className="text-3xl font-bold text-pink-600">Post a New Campaign</h1>
        <p className="mt-4 text-gray-600">
          Fill out the campaign details and launch your collaboration.
        </p>
      </div>
    </>
  );
};

export default PostCampaign;
